import React from "react";
import { HeaderTop } from "../Header/Header";
import Footer from "../Footer/Footer";

import "../Registration/Registration.scss";

export default function Registration() {
    function openPersonalTab() {

    }

    function openContactTab() {

    }

    return (
        <>
            <header className="header">
                <div className="header__container">
                    <HeaderTop tabs="true" openPersonalTab={openPersonalTab} openContactTab={openContactTab} />
                </div>
            </header>
            <main className="main">
                <div className="main__registration registration">
                    <section className={"registration__personal personal"}>

                    </section>
                    <section className={"registration__contacts contacts"}>

                    </section>
                </div>
            </main>
            <Footer />
        </>
    );
}
